description:
XXX Apartments Ep-02

Aman is having a hard time at college. His English professor Ms. Monica won't leave him in peace. She interrupts his daydreams in class, she scolds him and makes him work after class every day. One day Aman has to drop by at his strict professor's house to return one of her book. Once &quot;inside&quot; he is surprised to find out that there is a lot more to Ms. Monica than meets the eye.

What secret has Aman uncovered? Does this have anything to do with her special interest in Aman? Will Aman score in the biggest test of his life? Read the new issue of XXX Apartments 2 - &quot;Teaching the Teacher a Lesson!!!&quot;

